import React from "react";
import styled from "styled-components";
import SVG from "../static/svg/svg";
const Container = styled.footer`
    width: 100%;
    background-color: black;
    height: 100px;
`;
const Footer = () => {
    return (
        <Container>
            <SVG type="github"></SVG>
        </Container>
    );
};
export default Footer;
